public void testWithCacheAndFetch() throws IOException
{
  final TestPrefetchableTextFilesFirehoseFactory factory =
      TestPrefetchableTextFilesFirehoseFactory.of(TEST_DIR);

  final List<Row> rows = new ArrayList<>();
